import React from "react";
import { Link } from "react-router-dom";
import './header.css';

function DashboardHeader(props) {
  return (

    <nav>
      <ul>
        <ul className="menuul">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/AdminMenu">Admin</Link></li>
        </ul>
      </ul>
    </nav>

    );
}
  export default DashboardHeader;
